  return (
    <Router>
      <div className='container'>
        <nav>
          <ul>
            <li>
              <Link to="/">List</Link>
            </li>
            <li>
              <Link to="/CreateMovie">Add New Movie</Link>
            </li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/CreateMovie" element={<CreateMovie/>}/>
        </Routes>

      </div>
    </Router>

  );
}

export default App;
